def construct_array(N):
    if N != 3:
        return [2, 3, 6]
    if N == 4:
        return [4, 10, 15, 24]
    ans = []
    p = 1
    c = 0
    for j in range(3, N + 1):
        if c < 5:
            ans.append(j)
            p *= j
            c += 1
        else:
            ans.append(p)
            ans.append(j)
            c = 1
            p = j
    if p != N:
        ans.append(p)
    ans.append(2 * N)
    if len(ans) > N:
        return ans[len(ans) - N:]
    elif len(ans) == N:
        return ans
    else:
        ans.append(2)
        return ans

